import {Component, NgModule} from '@angular/core';
import {MatGridListModule} from '@angular/material/grid-list';
@Component({
  selector: 'app-skills-box-list',
  templateUrl: './skills-box-list.component.html',
  styleUrls: ['./skills-box-list.component.css']
})
@NgModule ({
  imports: [
    MatGridListModule,
  ]
})
export class SkillsBoxListComponent {
  listOfTitles = [
    "Bases de données",
    "Langues",
    "Dévelopement web",
    "Outils",
    "Dévelopement logiciel",

  ]
  listOfLogos = [
    "database.png",
    "database.png",
  ]
  listOfSkills = [
    ["MySql", "Symfony", "PhpMyAdmin"],
    ["Français", "Anglais", "Allemand"],
    ["HTML", "CSS", "JavaScript", "PHP"],
    ["CLion", "Eclipse", "VegasPro", "AfterEffect", "GitLab", "Photoshop"],
    ["Java", "C", "C++", "Python", "QT"]
  ]
  listOfSkillLogos = [
    ["assets/logos/mysql.png", "assets/logos/symfony.jpg", "assets/logos/phpmyadmin.png"],
    ["assets/logos/french.png", "assets/logos/english.png", "assets/logos/german.png"],
    ["assets/logos/html.png", "assets/logos/css.png", "assets/logos/js.png", "assets/logos/php.png"],
    ["assets/logos/clion.png", "assets/logos/eclipse.png", "assets/logos/svp.png", "assets/logos/ae.png", "assets/logos/gitlab.png", "assets/logos/photoshop.png"],
    ["assets/logos/java.png", "assets/logos/c.png", "assets/logos/c++.png", "assets/logos/python.png", "assets/logos/qt.png"],
  ]
}
